string args = string.Format("/s=A {0}",sessionFile);
string progs = Environment.GetFolderPath(Environment.SpecialFolder.ProgramFiles);
string cmd = string.Format(@"{0}\IBM\Personal Communications\pcsws.exe",progs);
ProcessStartInfo p = new ProcessStartInfo(cmd, args);
p.RedirectStandardInput = true;
p.RedirectStandardOutput = true;
p.RedirectStandardError = true;
p.UseShellExecute = false;
Process.Start(p);
